import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Helmet } from "react-helmet";
import Home from "./Components/Home";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<><Home/></>} />
        </Routes>
      </BrowserRouter>

      <Helmet>

      </Helmet>
    </>
  );
}

export default App;
